import React from 'react';

const HomePage = () => {
  return (
    <div className="container mt-5">
      <h1 className="text-center">Welcome to BOOK MY PARTYS</h1>
      <p className="lead text-center">
        Plan your next event with us. Signup now and explore our services!
      </p>
    </div>
  );
};

export default HomePage;
